import React from "react";

function CreateQuizPopup() {
  return (
    <div
      style={{
        paddingBottom: "5vh",
        paddingTop: "5vh",
        paddingRight: "5vw",
        paddingLeft: "5vw",
        marginLeft: "3vw",
        backgroundColor: "white",
        borderRadius: "10px",
      }}
    >
      <input style={{paddingTop:"1vh",paddingBottom:"1vh"}}type="text" placeholder="Hi"></input>
    </div>
  );
}

export default CreateQuizPopup;
